import React, { useRef, useEffect, useState } from 'react';
import axios from 'axios';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import Typography from '@mui/material/Typography';


import CardItem from './CardItem';

const Item = styled(Paper)(({ theme }) => ({
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));

const App = () => {
    const [recommendationData, setRecommendationData] = useState();
    const [isLoaded, setIsLoaded] = useState(false);

    useEffect(() => {
    axios.get('http://localhost:8080/recommend')
            .then((response) => {
                console.log(response);
                setRecommendationData(response.data);
            }).catch((error) => {
                console.log(error);
            }).then(()=>{
                console.log("Finally")
            });  
    },[]);

    useEffect(()=> {
        if (!recommendationData) return;
        setIsLoaded(true);
        console.log("do render")

    });


    return (

    <Grid container spacing={2} >
        <Grid item xs={12}>
            <Typography sx={{ mt: 4, mb: 2}} variant="h2" component="div" textAlign="center">
                Coins Recommendation
            </Typography>
        </Grid>
        <Grid item xs = {4} > </Grid>
        <Grid item xs = {2} >
            <Typography sx={{ mt: 4, mb: 2, paddingRight: 10}} variant="h4" component="div" textAlign= "center" >
                    BTC
            </Typography>
        </Grid>
        <Grid item xs = {2}>
            <Typography sx={{ mt: 4, mb: 2, paddingLeft: 10}} variant="h4" component="div" textAlign= "center" >
                     ETH
            </Typography>
        </Grid>
        <Grid item xs = {4} > </Grid>
        <Grid item xs={5} md ={6} container justifyContent="right"  >

            {recommendationData ? 
            recommendationData.exchangeBTCList.map((item, index) => {

            return ( 
                    <Item key = {index}>
                        <CardItem item = {item}/> 
                    </ Item>
                    );
                }

            ) : null}
        </Grid>

        <Grid item xs={5} md ={6} container justifyContent="left"  >

            {recommendationData ? 
            recommendationData.exchangeETHList.map((item, index) => {

            return (
                    <Item key = {index}>
                        <CardItem item = {item}/> 
                    </ Item>);
               }) : null }
        </Grid> 

        <Grid item xs={12} >

            <Typography sx={{ mt: 4, mb: 2}} variant="h3" component="div" textAlign="center">
                Recommendation Buy and Sell
            </Typography>
        </Grid>

            <Grid item xs = {6}>
            <Typography sx={{ mt: 4, mb: 2, textAlign: "center"}} variant="h6" component="div">
                    BTC
            </Typography>
            </Grid>
            <Grid item xs = {6}>
            <Typography sx={{ mt: 4, mb: 2, textAlign: "center"}} variant="h6" component="div">
                     ETH
            </Typography>
            </Grid>



            <Grid item xs={2}   >
                <Item> 
                <Typography variant="h5" component="div"> Where Buy BTC </Typography>
                <Typography variant="h5" component="div">

                     {recommendationData.recommendBTCBuy.exchangeName}
                 </Typography>
                <Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>

                 Coin:
                 {recommendationData.recommendBTCBuy.type}
                </Typography>
                <Typography sx={{ mb: 1.5 }} color="text.secondary">
                 Buy on  
                ${recommendationData.recommendBTCBuy.ask}
                </Typography>

                </Item>
            </Grid>
            <Grid item xs={2}   >
            <Item> 
                <Typography variant="h5" component="div">Where Sell BTC </Typography>
                {/* <Typography variant="h5" component="div">

                     {recommendationData.recommendBTCSell.exchangeName}
             </Typography> */}
                <Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>

                 Coin:
                 {recommendationData.recommendBTCSell.type}
                </Typography>
                <Typography sx={{ mb: 1.5 }} color="text.secondary">
                 Sell on  
                ${recommendationData.recommendBTCSell.ask}
                </Typography>

                </Item>
            </Grid>

            <Grid item xs={2}   >
                </Grid>

            <Grid item xs={2}   >
            <Item> 
                <Typography variant="h5" component="div" color="text.secondary">Where Buy ETH </Typography>
                <Typography variant="h5" component="div">

                     {recommendationData.recommendETHBuy.exchangeName}
             </Typography>
                <Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>

                 Coin:
                 {recommendationData.recommendETHBuy.type}
                </Typography>
                <Typography sx={{ mb: 1.5 }} color="text.secondary">
                 Buy on  
                ${recommendationData.recommendETHBuy.ask}
                </Typography>

                </Item>
            </Grid>
            <Grid item xs={2}   >
            <Item> 
                <Typography variant="h5" component="div">Where Sell ETH </Typography>
                <Typography variant="h5" component="div">

                     {recommendationData.recommendETHSell.exchangeName}
             </Typography>
                <Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>

                 Coin:
                 {recommendationData.recommendETHSell.type}
                </Typography>
                <Typography sx={{ mb: 1.5 }} color="text.secondary">
                 Sell on  
                ${recommendationData.recommendETHSell.ask}
                </Typography>

                </Item>
            </Grid>

       <Grid item xs= {12} height = {100}/>

      </Grid>
      );
}

export default App;
